static void DumpSlots(void)
{
	uint8_t buf[24];
	uint32_t addr=0x13b4;
	uint32_t n=24;
	bool ok;

	while (addr<CONFIG_LENGTH)
	{
		n = MIN(CONFIG_LENGTH-addr, sizeof(buf));
		if(n<24)
		{
			break;
		}
		ok = FALSE;
		while (!ok)
		{
			if (Read(addr, n, buf))
			{
				DEBUG_MSG("Location: 0x%04x, Name: %c%c%c, DispALL: %d, ",addr,buf[0],buf[1],buf[2],(buf[5]>>0)&0x01);
				DEBUG_MSG("page: %d, position: 0x%02x, 0x%02x, ", buf[15], buf[21],buf[22]);
				DEBUG_MSG("hLimEn: %d, lLimEn: %d, autoSW: %d, limit: %d, Raw: ", (buf[4]>>4)&0x01, (buf[4]>>3)&0x01, (buf[4]>>1)&0x01, (((uint16_t)buf[13])<<8)+buf[12]);
				for(uint32_t i=0; i<n; i++)
					DEBUG_MSG("0x%02x, ", buf[i]);
				vTaskDelay(100 / portTICK_RATE_MS);
				//PIOS_COM_SendBuffer(DEBUG_PORT, buf, n);
				ok = TRUE;
			}
		}
		DEBUG_MSG("\n\r");
		addr += n;
	}
}

static void DumpSetup(void)
{
	uint8_t buf[48];
	uint32_t addr=0;
	uint32_t n=24;
	bool ok;

	n = MIN(CONFIG_LENGTH-addr, sizeof(buf));
	ok = FALSE;
	while (!ok)
	{
		if (Read(addr, n, buf))
		{
			// N=NTSC, P=PAL, S=Secam, U=unknown
			uint8_t videoSystem = buf[14]==0xe0?'N':((buf[14]==0xee)?'P':((buf[14]==0xef)?'S':'U'));
			DEBUG_MSG("Version: %c%c%c%c, ",buf[0],buf[1],buf[2],buf[3]);
			DEBUG_MSG("VideoSystem: %c, ",videoSystem);
			DEBUG_MSG("OSDOnIfAlarm: %d, ",(buf[15]>>1)&0x01);
			DEBUG_MSG("osdRXon %d, ",(buf[15]>>0)&0x01);
			DEBUG_MSG("req3Dfix %d, ",(buf[15]>>4)&0x01);
			DEBUG_MSG("pageTime %d, ",buf[7]);
			DEBUG_MSG("MaxVsLive %d, ",buf[8]);
			DEBUG_MSG("reqSats %d, ",buf[9]);
			DEBUG_MSG("waitAfterFix %d, ",buf[26]);
			DEBUG_MSG("RXpageSw %d, ",(buf[6]&0x03)==0x03?1:0);
			DEBUG_MSG("RAW: ");
			for(uint32_t i=0; i<n; i++)
				DEBUG_MSG("0x%02x, ", buf[i]);
			vTaskDelay(100 / portTICK_RATE_MS);
			//PIOS_COM_SendBuffer(DEBUG_PORT, buf, n);
			ok = TRUE;
		}
	}
	DEBUG_MSG("\n\r");
}

